INSERT INTO `fa_dano` VALUES (1, '维护通知', '尊敬的用户，为了提升系统性能和用户体验，我们将于2024年1月16日凌晨2:00-6:00进行系统维护升级。维护期间，部分功能可能暂时无法使用，给您带来的不便敬请谅解。维护完成后，系统将恢复正常运行，并新增多项实用功能。感谢您的理解与支持！', '2025-07-30 17:21:14', 100, 1, '2025-07-30 17:22:24');
INSERT INTO `fa_dano` VALUES (2, '新功能上线', '亲爱的用户，我们很高兴地宣布，平台新增了智能推荐功能！该功能基于您的使用习惯和偏好，为您推荐最适合的彩票玩法和号码组合。同时，我们还优化了用户界面，提升了操作流畅度。快来体验全新的功能吧！', '2025-07-30 17:21:14', 90, 1, '2025-07-30 17:22:16');
INSERT INTO `fa_dano` VALUES (3, '春节活动', '春节将至，为了回馈广大用户的支持，我们特别推出春节大礼包活动！活动期间，新用户注册即送88元红包，老用户每日签到可获得随机红包奖励。此外，还有充值返利、邀请好友等多重福利等您来拿。活动时间：2024年1月20日-2024年2月20日，机会难得，不要错过！', '2025-07-30 17:21:14', 80, 1, '2025-07-30 17:47:44');
INSERT INTO `fa_lottery_bonus` VALUES (1, 15, '直选复式', 'zhixuan_fushi', 2.00, 10000.00, '[\"1800\"]', 1, '玩法说明：从百位、十位、个位中选择一个3位数号码组成一注，所选号码与开奖号码相同，且顺序一致，即为中奖。\r\n\r\n投注方案：3,4,5；开奖号码：345，顺序一致，即中奖。', 0, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (2, 15, '直选和值', 'zhixuan_hezhi', 10.00, 5000.00, '[\"9000\",\"3000\",\"1500\",\"900\",\"600\",\"428\",\"320\",\"250\",\"200\",\"163\",\"142\",\"130\",\"123\",\"120\",\"120\",\"123\",\"130\",\"142\",\"163\",\"200\",\"250\",\"320\",\"428\",\"600\",\"900\",\"1500\",\"3000\",\"9000\"]', 1, '玩法说明：选择1个号码，与开奖号码的百位、十位、个位三个数字相加之和相同，即中奖。\r\n\r\n投注方案：1；开奖号码：001、010、100,即中奖。', 0, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (3, 15, '直选跨度', 'zhixuan_kuadu', 10.00, 1000.00, '[\"900\",\"160\",\"93\",\"70\",\"62\",\"60\",\"62\",\"70\",\"93\",\"166\"]', 1, '选择开奖号码的跨度，跨度为开奖号码中最大数字与最小数字的差值，跨度范围0-9。例如开奖号码357，跨度为7-3=4。', 0, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (4, 15, '组三单式', 'zusan_danshi', 2.00, 1000.00, '[\"600\"]', 1, '玩法说明：选择2位数号码组成一注，所选号码与开奖号码相同，且顺序不限，即为中奖。\r\n\r\n投注方案：221，开奖号码是122，212，221，即为中奖。', 0, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (5, 15, '组三复式', 'zusan_fushi', 10.00, 2000.00, '{\"2\":\"1500\",\"3\":\"500\",\"4\":\"250\",\"5\":\"150\",\"6\":\"100\",\"7\":\"72\",\"8\":\"54\",\"9\":\"42\",\"10\":\"12\"}', 1, '玩法说明：从0-9中选择2个数字组成两注，所选号码与开奖号码相同，且顺序不限，即为中奖。\r\n\r\n投注方案：12（展开为122,212,221和112,121,211），开奖号码为212或121，即为中奖。', 6, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (6, 15, '组六复式', 'zuliu_fushi', 10.00, 3000.00, '{\"3\":\"600\",\"4\":\"300\",\"5\":\"150\",\"6\":\"75\",\"7\":\"43\",\"8\":\"27\",\"9\":\"18\",\"10\":\"12\"}', 1, '玩法说明：从0-9中任意选择3个号码组成一注，所选号码与开奖号码相同，顺序不限，即为中奖。\r\n\r\n投注方案：123；开奖号码：三位包含123，顺序不限，即中奖。', 4, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (7, 15, '一码定位', 'zuxuan_yima_dingwei', 2.00, 1000.00, '[\"10\"]', 1, '从百位、十位、个位中选择一个位置，再选择一个或多个号码，开奖号码对应位置包含所选号码即为中奖。例如选择百位5，开奖号码5XX即中奖。', 15, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (8, 15, '两码定位', 'zuxuan_liangma_dingwei', 2.00, 1500.00, '[\"100\"]', 1, '从百位、十位、个位中选择两个位置，再分别选择号码，开奖号码对应位置都包含所选号码即为中奖。例如选择百位5十位3，开奖号码53X即中奖。', 14, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (9, 15, '一码不定位', 'zuxuan_yima_budingwei', 2.00, 800.00, '[\"3.5\"]', 1, '选择一个或多个号码，开奖号码的百位、十位、个位中任意一位包含所选号码即为中奖。例如选择5，开奖号码5XX、X5X、XX5任意一个都中奖。', 13, 1, NULL);
